import React from "react";

import Message from "components";

const Chat = ({ messages }) => {
  return (
    <div className="chat__cnt">
      <div className="chat__cnt--messages">
        {messages && messages.map(item => <Message text={item.text} />)}
      </div>
    </div>
  );
};

export default Chat;
